import React from "react";

function OrderItem({date,code,price}) {
    return (
        <a href={`/order/:${code}`} className="orderItem">
            <div className="general">
                <div className="date">{date}</div>
                <div className="down">
                    <div>
                        <span className="title">Цена:</span>
                        <span>{price}</span>
                    </div>
                </div>
            </div>
            <div className="more">
                Подробнее
            </div>
        </a>
    )
}

export default OrderItem;
